const myButton = ({text, type, onClick}) => {
    return <button className={"MyButton"} onClick={onClick}>
        {text}
    </button>
}

export default myButton;

// text: 버튼의 text
// type: 어떤 버튼인지 구분
// onClick: 클릭했을 때의 동작
